import React, { useState, useEffect } from "react";
import {
  Container,
  TextField,
  Button,
  Typography,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Chip,
  Grid,
} from "@mui/material";
import { ToastContainer, toast } from "react-toastify";
import { motion } from "framer-motion";
import "react-toastify/dist/ReactToastify.css";

const CheckBill = () => {
  const [participants, setParticipants] = useState([]);
  const [foodItems, setFoodItems] = useState([]);
  const [currentFood, setCurrentFood] = useState({
    name: "",
    price: "",
    sharedWith: [],
  });
  const [newParticipant, setNewParticipant] = useState("");
  const [editingFoodIndex, setEditingFoodIndex] = useState(null);

  // Load participants and food items from localStorage
  useEffect(() => {
    const savedParticipants = JSON.parse(localStorage.getItem("participants")) || [];
    const savedFoodItems = JSON.parse(localStorage.getItem("foodItems")) || [];
    setParticipants(savedParticipants);
    setFoodItems(savedFoodItems);
  }, []);

  // Save participants and food items to localStorage whenever they change
  useEffect(() => {
    localStorage.setItem("participants", JSON.stringify(participants));
    localStorage.setItem("foodItems", JSON.stringify(foodItems));
  }, [participants, foodItems]);

  const addParticipant = () => {
    if (newParticipant.trim() === "") {
      toast.error("Participant name cannot be empty!");
      return;
    }
    if (participants.includes(newParticipant)) {
      toast.error("Participant already added!");
      return;
    }
    setParticipants((prev) => [...prev, newParticipant]);
    setNewParticipant("");
    toast.success("Participant added!");
  };

  const handleFoodChange = (field, value) => {
    setCurrentFood((prev) => ({ ...prev, [field]: value }));
  };

  const addFoodItem = () => {
    if (!currentFood.name || currentFood.price <= 0 || !currentFood.sharedWith.length) {
      toast.error("Please fill in all fields correctly!");
      return;
    }

    const newFoodItem = {
      name: currentFood.name,
      price: parseFloat(currentFood.price),
      sharedWith: currentFood.sharedWith,
    };

    if (editingFoodIndex !== null) {
      const updatedFoodItems = [...foodItems];
      updatedFoodItems[editingFoodIndex] = newFoodItem;
      setFoodItems(updatedFoodItems);
      setEditingFoodIndex(null);
    } else {
      setFoodItems((prev) => [...prev, newFoodItem]);
    }

    resetCurrentFood();
    toast.success("Food item added!");
  };

  const resetCurrentFood = () => {
    setCurrentFood({ name: "", price: "", sharedWith: [] });
  };

  const deleteFoodItem = (index) => {
    setFoodItems((prev) => prev.filter((_, i) => i !== index));
    toast.success("Food item deleted!");
  };

  const editFoodItem = (index) => {
    setCurrentFood(foodItems[index]);
    setEditingFoodIndex(index);
  };

  const totalExpenses = participants.map((_, index) => {
    return foodItems.reduce((total, foodItem) => {
      const shareAmount = foodItem.sharedWith[index] ? foodItem.price / foodItem.sharedWith.filter(Boolean).length : 0;
      return total + shareAmount;
    }, 0);
  });

  const resetParticipants = () => {
    setParticipants([]);
    localStorage.removeItem("participants");
    toast.info("All participants reset!");
  };

  const resetFoodItems = () => {
    setFoodItems([]);
    localStorage.removeItem("foodItems");
    toast.info("All food items reset!");
  };

  return (
    <Container style={{ padding: "40px" }}>
      <Typography variant="h4" style={{ textAlign: "center", marginBottom: "30px" }}>
        CheckBills
      </Typography>

      <motion.div
        style={{ marginBottom: "20px", padding: "20px", backgroundColor: "#ffffff", borderRadius: "8px" }}
        initial={{ opacity: 0, y: -20 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.5 }}
      >
        <Typography variant="h6">Add Participants</Typography>
        <Grid container spacing={1} alignItems="center">
          <Grid item xs={8}>
            <TextField
              label="Participant Name"
              value={newParticipant}
              onChange={(e) => setNewParticipant(e.target.value)}
              fullWidth
              variant="outlined"
              style={{ marginBottom: "10px" }}
            />
          </Grid>
          <Grid item xs={4}>
            <Button variant="contained" color="primary" onClick={addParticipant}>
              Add
            </Button>
          </Grid>
        </Grid>
        <div style={{ display: "flex", flexWrap: "wrap", marginTop: "10px" }}>
          {participants.map((participant, index) => (
            <Chip
              key={index}
              label={participant}
              onDelete={() => setParticipants((prev) => prev.filter((p) => p !== participant))}
              style={{ margin: "5px", backgroundColor: "#FFCCFF", color: "#000" }}
            />
          ))}
        </div>
        <Button variant="outlined" color="secondary" onClick={resetParticipants}>
          Reset All Participants
        </Button>
      </motion.div>

      <motion.div
        style={{ marginBottom: "20px", padding: "20px", backgroundColor: "#ffffff", borderRadius: "8px" }}
        initial={{ opacity: 0, y: -20 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.5 }}
      >
        <Typography variant="h6">Add Food Items</Typography>
        <TextField
          label="Food Name"
          value={currentFood.name}
          onChange={(e) => handleFoodChange("name", e.target.value)}
          fullWidth
          variant="outlined"
          style={{ marginBottom: "10px" }}
        />
        <TextField
          label="Price"
          type="number"
          value={currentFood.price}
          onChange={(e) => handleFoodChange("price", e.target.value)}
          fullWidth
          variant="outlined"
          style={{ marginBottom: "10px" }}
        />
        <Grid container spacing={1}>
          {participants.map((participant, index) => (
            <Grid item xs={4} key={index}>
              <label>
                <input
                  type="checkbox"
                  checked={currentFood.sharedWith[index] || false}
                  onChange={() => {
                    const updatedSharedWith = [...currentFood.sharedWith];
                    updatedSharedWith[index] = !updatedSharedWith[index];
                    handleFoodChange("sharedWith", updatedSharedWith);
                  }}
                />
                {participant}
              </label>
            </Grid>
          ))}
        </Grid>
        <Button variant="contained" color="primary" onClick={addFoodItem}>
          {editingFoodIndex !== null ? "Update Food Item" : "Add Food Item"}
        </Button>
      </motion.div>

      <TableContainer>
        <Table>
          <TableHead>
            <TableRow>
              <TableCell>Food Item</TableCell>
              <TableCell>Price</TableCell>
              <TableCell>Shared With</TableCell>
              <TableCell>Actions</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {foodItems.map((item, index) => (
              <TableRow key={index}>
                <TableCell>{item.name}</TableCell>
                <TableCell>{item.price}</TableCell>
                <TableCell>{item.sharedWith.map((isShared, i) => (isShared ? participants[i] + " " : "")).join(", ")}</TableCell>
                <TableCell>
                  <Button onClick={() => editFoodItem(index)}>Edit</Button>
                  <Button onClick={() => deleteFoodItem(index)}>Delete</Button>
                </TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>

      <Button variant="outlined" color="secondary" onClick={resetFoodItems}>
        Reset All Food Items
      </Button>

      <ToastContainer />
    </Container>
  );
};

export default CheckBill;
